    public static string RandomRows(uint number)
    {
        if (_rows.Length == 0) {
            InitRows();
        }

        var random = new Random();
        var randomRows = new List<string>();
        
        for (var i = 0; i < number; i++) {
            var randomIndex = random.Next(0, _rows.Length);
            randomRows.Add(_rows[randomIndex]);
        }
        return string.Join("\n", randomRows);
    }
    
    private static string[] _rows = [];

    private static void InitRows()
    {
        _rows = GetData.Split(Environment.NewLine);
    }
